import styles from './Ingredients.module.css';

export default function RecipeIngredients() {

   const ingredients = ["2 Shot Espresso", "1 Tbsp Pumpkin Puree", "2 tsp Maple Syrup", "1/2 tsp Vanilla Extract", "italian chicken sausage"];
   return(
      <div>
         <h3>Recipe Ingredients</h3>
         <ul className = {styles.ingredientList} >
            <li>{ingredients[0]}</li>
            <li>{ingredients[1]}</li>
            <li>{ingredients[2]}</li>
            <li>{ingredients[3]}</li>
            <li>{ingredients[4]}</li>
         </ul>
      </div>
   );
}
